// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/access/AccessControl.sol";
import "./MediaLibrary.sol";
import "./PriviNFT.sol";

contract MediaFractionalizeManager is AccessControl {
    using MediaLibrary for Media;

    bytes32 public constant ADMIN = keccak256("admin");
    // this is the role for the media manager contract
    bytes32 public constant MEDIA_ADMIN = keccak256("media_admin");

    address public immutable priviNFTContractAddress;

    PriviNFT private immutable _priviNFT;

    // map from media to collabs
    mapping(uint256 => mapping(uint256 => ShareHolder)) private _owners;

    event Fractionalize(address indexed from, uint256 indexed mediaId);

    constructor(address _priviNFTContractAddress) {
        _setupRole(DEFAULT_ADMIN_ROLE, msg.sender);
        _setupRole(ADMIN, msg.sender);
        priviNFTContractAddress = _priviNFTContractAddress;
        _priviNFT = PriviNFT(_priviNFTContractAddress);
    }

    // allows an owner to fractionalize its sharing into one or more addresses
    // ! renamed from fractionalizeMediaCollab to fractionalizeMediaOwners
    function fractionalizeMediaOwners(uint256 _mediaId, ShareHolder[] memory _sharings) external {
        require(_sharings.length > 0, "Can't fractionalize to 0 shares");

        Media memory media = _priviNFT.getMedia(_mediaId);

        int256 index = media.getOwnerIndex(msg.sender, _owners[_mediaId]);
        require(index >= 0, "Requester is not a collaborator of this media");

        // add new owners, and delete the previous one
        uint256 totalShares = 0;
        uint256 ownersNewSize = media.ownersSize - 1;
        bool found;
        for (uint256 i; i < _sharings.length; i++) {
            // search if already exists
            found = false;
            for (uint256 j; j < media.ownersSize; j++) {
                if (_sharings[i].holderAddress == _owners[_mediaId][j].holderAddress) {
                    if (j == uint256(index)) {
                        continue;
                    }
                    _owners[_mediaId][j].share += uint160(
                        (_sharings[i].share * _owners[_mediaId][uint256(index)].share) /
                            MediaLibrary.SHARES_DENOMINATOR
                    );
                    found = true;
                    break;
                }
            }

            totalShares += _sharings[i].share;

            if (found) {
                found = false;
                continue;
            } else {
                ownersNewSize += 1;
                _sharings[i].share = uint160(
                    (_sharings[i].share * _owners[_mediaId][uint256(index)].share) /
                        MediaLibrary.SHARES_DENOMINATOR
                );
                _owners[_mediaId][media.ownersSize + i] = _sharings[i];
            }
        }

        // check total shares being equal to SHARES_DENOMINATOR, cannot be missing shares
        require(totalShares == MediaLibrary.SHARES_DENOMINATOR, "Invalid total distributed shares");

        // delete current collab to recover gas
        delete _owners[_mediaId][uint256(index)];

        if (ownersNewSize != uint256(index)) {
            _owners[_mediaId][uint256(index)] = _owners[_mediaId][ownersNewSize];
            delete _owners[_mediaId][ownersNewSize];
        }

        // update the ownersSize to the new value
        if (media.ownersSize != ownersNewSize) {
            _priviNFT.updateMediaOwnersSize(_mediaId, ownersNewSize);
        }

        emit Fractionalize(msg.sender, _mediaId);
    }

    // allow admins to set the initial owners of a media
    function setInitialOwners(uint256 _mediaId, ShareHolder[] memory _initialOwners)
        external
        onlyRole(MEDIA_ADMIN)
    {
        for (uint256 i; i < _initialOwners.length; i++) {
            _owners[_mediaId][i] = _initialOwners[i];
        }
    }

    // allow admins to see the owners of a media
    function getMediaOwners(uint256 _mediaId) external view onlyRole(ADMIN) returns (ShareHolder[] memory) {
        Media memory media = _priviNFT.getMedia(_mediaId);
        return media.getOwners(_owners[_mediaId]);
    }

    function getOwnerIndex(address _owner, uint256 _mediaId) public view onlyRole(ADMIN) returns (int256) {
        Media memory media = _priviNFT.getMedia(_mediaId);
        return media.getOwnerIndex(_owner, _owners[_mediaId]);
    }

    function getOwnersAddresses(uint256 _mediaId) external view onlyRole(ADMIN) returns (address[] memory) {
        Media memory media = _priviNFT.getMedia(_mediaId);
        return media.getOwnersAddresses(_owners[_mediaId]);
    }

    function balanceOf(address _holder, uint256 _mediaId) external view returns (uint256) {
        int256 ownerIndex = getOwnerIndex(_holder, _mediaId);
        if (ownerIndex == -1) {
            return 0;
        }
        return _owners[_mediaId][uint256(ownerIndex)].share;
    }
}
